// CodeforcesInfo.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CodeforcesInfo = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('https://codeforces.com/api/user.info?handles=Tspectre');
        setData(response.data.result[0]);
      } catch (error) {
        console.error('Error fetching Codeforces data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      {data ? (
        <div>
          <h2>{data.handle}</h2>
          <p>Rating: {data.lastOnlineTimeSeconds}</p>
          {/* Display other Codeforces information as needed */}
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default CodeforcesInfo;
